import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom'; // Import Router
import { useSelector } from 'react-redux';
import Admin from './pages/Admin';
import Home from './pages/Home';
import About from './pages/About';
import Login from './pages/Login';
import 'bootstrap/dist/css/bootstrap.min.css';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Footer from './pages/Footer/Footer';
import Contact from './pages/Contact';
import Jobs from './pages/Jobs';
import CompanyShowcase from './pages/CompanyShowcase';

const PrivateRoute = ({ element: Component, ...rest }) => {
  const isLoggedIn = useSelector((state) => state.auth.isLoggedIn);

  return (
    <Route
      {...rest}
      element={isLoggedIn ? <Component /> : <Navigate to="/login" />}
    />
  );
};

function App() {
  return (
    <div className="App">
      <Router> {/* Use Router */}
        <Navbar bg="primary" variant="dark">
          <Container>
            <Navbar.Brand href="/">Job website</Navbar.Brand>
            <Nav className="me-auto">
              <Nav.Link href="/">Home</Nav.Link>
              <Nav.Link href="/about">About</Nav.Link>
              <Nav.Link href="/contact">Contact</Nav.Link>
              <Nav.Link href="/jobs">Jobs</Nav.Link>
              <Nav.Link href="/companies">Company Showcase</Nav.Link>
            </Nav>
          </Container>
        </Navbar>
        <Routes>
          <Route path="/login" element={<Login />} />
          <PrivateRoute path="/" element={<Home />} />
          <PrivateRoute path="/about" element={<About />} />
          <PrivateRoute path="/contact" element={<Contact />} />
          <PrivateRoute path="/jobs" element={<Jobs />} />
          <PrivateRoute path="/companies" element={<CompanyShowcase />} />
          <PrivateRoute path="/admin" element={<Admin />} />
          <Route path="*" element={<Navigate to="/login" />} />
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
